import classes from './NewPost.module.css';
import React from 'react';

const NewPost = () => {

    const onAddTitle=(evt)=>{
        console.log(evt);
    }
    onAddContent=(evt)=>{
        console.log(evt.current);
    }
    const onSubmit = (data) => {
        alert('test');
    };

    return (
        <form onSubmit={onSubmit} className={classes.form}>
            <div className={classes.control}>
                <input id='title' onChange={onAddTitle} required/>
            </div>
            <div className={classes.control}>
                <input type='password' id='password' onChange={onAddContent} required placeholder="Enter Password" />
            </div>
            <div className={classes.actions}>
                <button >Submit</button>
            </div>
        </form>
    );
}

export default NewPost;
